import React, { Component } from "react";

export default class Practice extends React.Component {
  constructor() {
    super();
    this.state = { name: "Ram yadav" };
  }
  render() {
    return (
      <div>
        <input type="text" placeholder="Name..." onChange={(e)=>{this.setState()}}/>
        <p>{this.state.name}</p>
      </div>
    );
  }
}
